import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <form onSubmit={handleSubmit}>
      <input 
        type="text" 
        value={name}
        onChange={({target}) => {setName(target.value)}}
      />
      <input 
        type="tel"
        value={phone}
        onChange={({target}) => {setPhone(target.value)}}
      />
      <input 
        type="email"
        value={email}
      />
      <input
        type="submit"
      />
    </form>
  );
};
